import React from "react";
import { Link } from "react-router-dom";
import axios from "axios";
import { useContext } from "react";
import UsernameContext from "./../../../UsernameContext";

const ProductInfo = props => {
  let { username } = useContext(UsernameContext);
  var addToCart = () => {
    axios.post;
  };
  return (
    <div>
      <div className="row">
        <div className="col-12 col-md-6">
          <img
            src="https://images.unsplash.com/photo-1518302057166-c990a3585cc3?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1267&q=80"
            className="card-img-top"
            alt="Unable to load"
          />
        </div>
        <div className="col-4 col-md-2">
          <h5 className="card-title text-right">Title:</h5>
          <p className="card-text text-right">About:</p>
          <p className="card-title text-right">Price:</p>
          <p className="card-text text-right">
            <small>Items In Stock:</small>
          </p>
        </div>
        <div className="col-8 col-md-4">
          <h5 className="card-title">{props.location.state.title}</h5>
          <p className="card-text">{props.location.state.description}</p>
          <p className="card-title">{props.location.state.price}</p>
          <p className="card-text">
            <small>{props.location.state.quantity}</small>
          </p>
          <div className="row">
            <Link to={"/merch/"} className="btn btn-light m-3">
              ADD TO CART
            </Link>
            <Link to={"/merch/"} className="btn btn-light m-3">
              BACK
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ProductInfo;
